const sidebarImageUrl = (state = '', action) => {  
    switch (action.type) {
        case 'BG_IMAGE_URL':
            return action.imgurl
        default:
            return state
    }
}

export default sidebarImageUrl

const initialState = {
    sidebarImageUrl: localStorage.getItem('image') || ''
}
